25;;;TopicGroup;;Mantelzorg geven;Mantelzorg  is zorg die iemand geeft aan een bekende uit zijn of haar omgeving, zoals een partner, kind of vriend, als deze persoon voor langere tijd ziek, hulpbehoevend of gehandicapt is. De mantelzorg kan bestaan uit het huishouden doen, wassen en aankleden, gezelschap houden, vervoer, geldzaken regelen enzovoort. Mantelzorg wordt niet betaald. Een vrijwilliger vanuit een vrijwilligerscentrale is geen mantelzorger.;;;;;;;;;;;;;;
